# === Handle categorical encoding ===
def encode_categoricals(df, label_encoders=None, is_training=True):
    cols_to_encode = cat_cols + ['Hour_Bin', 'Age_Category', 'Transaction_Size', 'Location_Device']
    if is_training:
        label_encoders = {}
        for col in cols_to_encode:
            if col in df.columns:
                le = LabelEncoder()
                df[col] = le.fit_transform(df[col].astype(str))
                label_encoders[col] = le
        return df, label_encoders
    else:
        for col in cols_to_encode:
            if col in df.columns and col in label_encoders:
                df[col] = df[col].astype(str).map(lambda x: 'Unknown' if x not in label_encoders[col].classes_ else x)
                if 'Unknown' not in label_encoders[col].classes_:
                    label_encoders[col].classes_ = np.append(label_encoders[col].classes_, 'Unknown')
                df[col] = label_encoders[col].transform(df[col])
        return df

# === Apply encoding ===
