# ### **Graph Construction**


def build_smart_graph(features_df, customer_ids, ips, pca_dim=16, k=5,
                      group_edge_cap=3, max_group_size_to_connect=200, max_edges=400000):
    """
    Build a compact graph:
      - features_df : DataFrame (preprocessed, scaled) for nodes
      - customer_ids, ips : arrays aligned to rows (can contain None)
    Returns: torch_geometric.data.Data
    """
    X = features_df.values.astype(np.float32)
    n = X.shape[0]

    # 1) PCA reduction for neighbor search (fast & memory-friendly)
    pca_dim = min(pca_dim, X.shape[1])
    pca = PCA(n_components=pca_dim, random_state=42)
    X_reduced = pca.fit_transform(X) if n > pca_dim else X.copy()

    edges = []
    edge_w = []

    # Helper to add edge (small utility)
    def add_edge(u, v, w):
        if u == v:
            return
        edges.append((int(u), int(v)))
        edge_w.append(float(w))

    # 2) Customer ID groups (strong edges) - capped per node
    cust = defaultdict(list)
    for idx, cid in enumerate(customer_ids):
        if cid is not None and cid == cid:  # guard NaN
            cust[cid].append(idx)
    for cid, idxs in cust.items():
        m = len(idxs)
        if m <= 1 or m > max_group_size_to_connect:
            continue
        # connect each node to up to 'group_edge_cap' other nodes in same group
        for idx in idxs:
            # choose up to group_edge_cap neighbors from the group (deterministic: nearest by index distance)
            others = [j for j in idxs if j != idx]
            # sample small subset to avoid huge cliques
            for j in others[:group_edge_cap]:
                add_edge(idx, j, 1.0)

    # 3) IP groups (medium edges)
    ipd = defaultdict(list)
    for idx, ip in enumerate(ips):
        if ip is not None and ip == ip:
            ipd[ip].append(idx)
    for ip, idxs in ipd.items():
        m = len(idxs)
        if m <= 1 or m > 200:
            continue
        for idx in idxs:
            others = [j for j in idxs if j != idx]
            for j in others[:min(2, len(others))]:
                # higher weight if different customers (we don't have customer ids here  optional)
                add_edge(idx, j, 0.5)

    # 4) k-NN edges on PCA features (weak edges)
    if n >= 2 and k >= 1:
        nbrs = NearestNeighbors(n_neighbors=min(k+1, n), algorithm="auto", metric="euclidean", n_jobs=-1)
        nbrs.fit(X_reduced)
        distances, neighbors = nbrs.kneighbors(X_reduced, return_distance=True)
        # neighbors[i][0] is self -> skip first
        for i in range(n):
            for nb_pos, dist in zip(neighbors[i][1:], distances[i][1:]):
                sim_w = 1.0 / (1.0 + float(dist))
                add_edge(i, int(nb_pos), 0.25 * sim_w)

    # Deduplicate edges and cap
    # make edges undirected (both directions)
    if len(edges) == 0:
        edge_index = torch.tensor([[i,i] for i in range(min(100,n))], dtype=torch.long).t()
        edge_attr = torch.ones(edge_index.shape[1], dtype=torch.float32)
    else:
        # combine and symmetrize
        edge_set = {}
        for (u, v), w in zip(edges, edge_w):
            if u == v:
                continue
            key = (min(u, v), max(u, v))
            # keep max weight if duplicate
            edge_set[key] = max(edge_set.get(key, 0.0), w)
        # optionally cap total edges by strongest weights
        items = list(edge_set.items())
        if len(items) > max_edges:
            # sort by weight desc and keep top max_edges
            items = sorted(items, key=lambda it: it[1], reverse=True)[:max_edges]
        # build symmetric edges
        edge_index_list = []
        edge_attr_list = []
        for (u, v), w in items:
            edge_index_list.append([u, v])
            edge_index_list.append([v, u])
            edge_attr_list.append(w)
            edge_attr_list.append(w)
        edge_index = torch.tensor(edge_index_list, dtype=torch.long).t().contiguous()
        edge_attr = torch.tensor(edge_attr_list, dtype=torch.float32)
        # normalize weights to 0-1
        if edge_attr.max() > 0:
            edge_attr = edge_attr / float(edge_attr.max())

    # Node features
    x = torch.tensor(X, dtype=torch.float32)
    # Add degree-like node feature (frequency)
    cust_freq = pd.Series(customer_ids).value_counts().to_dict()
    ip_freq = pd.Series(ips).value_counts().to_dict()

    cust_deg = np.array([cust_freq.get(cid, 1) for cid in customer_ids], dtype=np.float32)
    ip_deg = np.array([ip_freq.get(ip, 1) for ip in ips], dtype=np.float32)
    deg_feat = np.log1p(cust_deg + ip_deg).reshape(-1, 1)  # log-scale

    # Append to node features
    x = np.concatenate([X, deg_feat], axis=1)
    x = torch.tensor(x, dtype=torch.float32)


    data = Data(x=x, edge_index=edge_index, edge_attr=edge_attr)
    return data

