# ### **GraphSAGE Encoder**


_HAS_NEIGHBOR_LOADER = True
class GraphSAGEClassifier(nn.Module):
    def __init__(self, in_channels, hidden_channels, num_classes, dropout=0.3):
        super().__init__()
        self.sage1 = SAGEConv(in_channels, hidden_channels)
        self.sage2 = SAGEConv(hidden_channels, hidden_channels)
        self.lin = nn.Linear(hidden_channels, num_classes)
        self.dropout = dropout

    def forward(self, x, edge_index):
        x = F.relu(self.sage1(x, edge_index))
        x = F.dropout(x, p=self.dropout, training=self.training)
        x = F.relu(self.sage2(x, edge_index))
        x = F.dropout(x, p=self.dropout, training=self.training)
        return self.lin(x)


def train_graph_autoencoder(data, embedding_dim=16, epochs=30, lr=0.01,
                            use_neighbor_loader=False, batch_size=1024):
    device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
    in_channels = data.x.shape[1]
    encoder = GraphSAGEClassifier(in_channels, hidden_channels=64, num_classes=embedding_dim).to(device)
    decoder = nn.Sequential(nn.Linear(embedding_dim, 64), nn.ReLU(), nn.Linear(64, in_channels)).to(device)

    optimizer = torch.optim.Adam(list(encoder.parameters()) + list(decoder.parameters()), lr=lr, weight_decay=1e-5)
    encoder.train(); decoder.train()

    if use_neighbor_loader and _HAS_NEIGHBOR_LOADER:
        # Use NeighborLoader for mini-batch training (memory efficient for large graphs)
        loader = NeighborLoader(data.to(device), num_neighbors=[10, 10], batch_size=batch_size, input_nodes=None, shuffle=True)
        for epoch in range(epochs):
            total_loss = 0.0
            for batch in loader:
                optimizer.zero_grad()
                batch = batch.to(device)
                emb = encoder(batch.x, batch.edge_index)
                recon = decoder(emb)
                loss = F.mse_loss(recon, batch.x)
                loss.backward(); optimizer.step()
                total_loss += float(loss)
            if (epoch+1) % 5 == 0:
                print(f"Epoch {epoch+1}/{epochs} - loss: {total_loss/len(loader):.4f}")
    else:
        # Full-batch training (works if you have enough RAM; faster per epoch)
        data = data.to(device)
        for epoch in range(epochs):
            optimizer.zero_grad()
            emb = encoder(data.x, data.edge_index)
            recon = decoder(emb)
            loss = F.mse_loss(recon, data.x) + 0.01 * emb.pow(2).mean()
            loss.backward()
            optimizer.step()
            if (epoch+1) % 5 == 0:
                print(f"Epoch {epoch+1}/{epochs} - Loss: {loss.item():.4f}")
    encoder.eval(); decoder.eval()
    return encoder.cpu(), decoder.cpu()

embedding_dim = 16
encoder, decoder = train_graph_autoencoder(train_graph, embedding_dim=embedding_dim, epochs=30, lr=0.01,use_neighbor_loader=False, batch_size=2048)
